  `create_time` datetime NOT NULL COMMENT '创建时间，insert操作时必须添加！',
  `updater` int(11) NOT NULL COMMENT '最后更新者，在sys_user表中的id，如果是insert操作，同创建者',
  `update_time` datetime NOT NULL COMMENT '最后更新时间，如果是insert操作，同创建时间',
  `del_flag` char(1) NOT NULL DEFAULT '0' COMMENT '删除状态,0未删除,1删除',
  `last_modify` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
