  KEY `del_flag` (`del_flag`) USING BTREE,
  KEY `last_modify` (`last_modify`) USING BTREE,
  KEY `type` (`type`(191)) USING BTREE,
  KEY `name` (`name`(191)) USING BTREE,
  KEY `parent_id` (`parent_id`) USING BTREE
